INSERT INTO `criterios_avaliativos` (`idcriterios_avaliativos`, `criterio`) VALUES
	(1, '<p>\n	1. Pontualidade: &eacute; pontual e cumpre os hor&aacute;rios das aulas, reuni&otilde;es e atividades programadas pelo seu setor</p>\n'),
	(2, '<p>\n	2. Assiduidade: sua presen&ccedil;a na Institui&ccedil;&atilde;o se faz sempre que necess&aacute;rio e participa ativamente de atividades como reuni&otilde;es pedag&oacute;gicas, reuni&otilde;es de pais e mestres, participa&ccedil;&atilde;o em planejamentos entre outros.</p>\n'),
	(3, '<p>\n	3. Organiza&ccedil;&atilde;o e disciplina: organiza, sistematiza e cumpre suas atividades respeitando os tempos h&aacute;beis &agrave;s necessidades institucionais.</p>\n'),
	(4, '<p>\n	4. Relacionamento: estabelece uma rela&ccedil;&atilde;o &eacute;tica e de respeito m&uacute;tuo, clima de participa&ccedil;&atilde;o e trabalho coletivo.</p>\n'),
	(5, '<p>\n	5. Interesse: interesse para desenvolver atividades de gest&atilde;o e/ou ensino, pesquisa e extens&atilde;o.</p>\n'),
	(6, '<p>\n	6. Metodologia: utiliza metodologias que incentivam a participa&ccedil;&atilde;o, discuss&atilde;o, express&atilde;o de ideias, direcionando suas atividades pedag&oacute;gicas e/ou de gest&atilde;o para forma&ccedil;&atilde;o do perfil humano e profissional do discente.</p>\n'),
	(7, '<p>\n	7. Avalia&ccedil;&atilde;o: utiliza adequadamente os instrumentos de avalia&ccedil;&atilde;o, de forma a identificar os avan&ccedil;os na aprendizagem do aluno e no desenvolvimento institucional.</p>\n'),
	(8, '<p>\n	8. Desenvolvimento profissional e pessoal: mant&eacute;m-se atualizado sobre novos conhecimentos e pr&aacute;ticas relacionadas ao processo de ensino, pesquisa e extens&atilde;o, aplicando-os na sua &aacute;rea de trabalho.</p>\n'),
	(9, '<p>\n	9. Compromisso institucional: demonstra envolvimento e comprometimento com o trabalho. Empenha-se em manter em bom estado de conserva&ccedil;&atilde;o os equipamentos utilizados e o local de trabalho. Apresenta o Plano de Ensino de cada disciplina no in&iacute;cio do semestre letivo.</p>\n'),
	(10, '<p>\n	10. &Eacute;tica: demonstra comportamento compat&iacute;vel com o C&oacute;digo de &Eacute;tica Profissional do Servidor P&uacute;blico Civil do Poder Executivo Federal, quanto a sigilo, discri&ccedil;&atilde;o, moralidade, integridade, educa&ccedil;&atilde;o, cortesia etc.</p>\n'),
	(11, '<p>\n	1. Pontualidade: &eacute; pontual e cumpre os hor&aacute;rios das aulas.</p>\n'),
	(12, '<p>\n	2. Conte&uacute;do: Apresenta o conte&uacute;do program&aacute;tico na disciplina</p>\n'),
	(13, '<p>\n	3. Organiza&ccedil;&atilde;o e disciplina: organiza, sistematiza e cumpre suas atividades em sala de aula.</p>\n'),
	(14, '<p>\n	4. Relacionamento: estabelece uma rela&ccedil;&atilde;o &eacute;tica e de respeito m&uacute;tuo, clima de participa&ccedil;&atilde;o e trabalho coletivo.</p>\n'),
	(15, '<p>\n	5. Incentiva a participa&ccedil;&atilde;o, discuss&atilde;o, express&atilde;o de ideias, direcionando suas atividades pedag&oacute;gicas e/ou de gest&atilde;o para forma&ccedil;&atilde;o do perfil humano e profissional do discente.</p>\n'),
	(16, '<p>\n	6. Avalia&ccedil;&atilde;o: utiliza adequadamente os instrumentos de avalia&ccedil;&atilde;o, de forma a identificar os avan&ccedil;os na aprendizagem do aluno.</p>\n'),
	(17, '<p>\n	7. Mant&eacute;m-se atualizado sobre novos conhecimentos e pr&aacute;ticas relacionadas ao processo de ensino, pesquisa e extens&atilde;o, aplicando-os na sua &aacute;rea de trabalho</p>\n'),
	(18, '<p>\n	8. Demonstra envolvimento e comprometimento com o trabalho. Empenha-se em manter em bom estado de conserva&ccedil;&atilde;o os equipamentos utilizados e o local de trabalho.</p>\n'),
	(19, '<p>\n	9. Demonstra comportamento compat&iacute;vel com o C&oacute;digo de &Eacute; tica Profissional do Servidor P&uacute;blico Civil do Poder Executivo Federal, quanto a sigilo, discri&ccedil;&atilde;o, moralidade, integridade, educa&ccedil;&atilde;o, cortesia etc.</p>\n'),
	(20, '<p>\n	10. Interesse em participar de eventos propostos pelo seu curso.</p>\n');
